import React, { useState, useEffect } from "react";
import Axios from "axios";
function Main() {
  const [robotList, setRobotList] = useState([]);
  useEffect(() => {
    const getRoboticsList = async () => {
      const { data: post } = await Axios.get(
        "http://localhost:3002/getpitstats"
      );
      setRobotList(post);
      console.log(robotList);
    };
    getRoboticsList();
  }, []);
  return (
    <div>
      {robotList.map((value, key) => {
        if (value.climb_level === 0) {
          value.climb_level = "None";
        } else if (value.climb_level === 1) {
          value.climb_level = "Low Bar";
        } else if (value.climb_level === 2) {
          value.climb_level = "Mid Bar";
        } else if (value.climb_level === 3) {
          value.climb_level = "High Bar";
        }
        return (
          <>
            <br />
            <div
              className="container rounded border "
              style={{ borderShadow: "1px 1px" }}
            >
              <h4>
                Team {value.team_number} |
                <span style={{ textSize: "13px" }}> {value.team_name}</span>
              </h4>
              <small className="moreInfo">
                {" "}
                Basic Stats{"   "}
                <i
                  class="fa-sharp fa-solid fa-angle-right"
                  style={{ transform: "rotate(0deg)", marginLeft: "10px" }}
                ></i>
                <div className="moreInfo_appear">
                  <div className="row">
                    <div className="col-4">
                      Auto Points:
                      <br />
                      Teleop Points:
                      <br />
                      High/Low Shooter:
                      <br />
                      Climb Level:
                      <br />
                      DriveTrain:
                    </div>
                    <div className="col-1" style={{ fontSize: "10px;" }}>
                      <u>{value.auto_points}</u>
                      <br />
                      <u>{value.teleop_points}</u>
                      <br />
                      <u>{value.climb_level}</u>
                      <br />
                      <u>{value.climb_level}</u>
                      <br />
                      <u>{value.drive_train}</u>
                    </div>
                  </div>
                </div>
              </small>
            </div>
          </>
        );
      })}
    </div>
  );
}

export default Main;
